                            ["custom"] = "function(s, e, ...)\
       -- first/second/third/fourth: 1 == casting, 2 == done frontal, 3 == done split, 4 == guranteed frontal, 5 == guranteed split.\
       -- casting: 1 == frontal, 2 == split\
       \
       if e == \"OPTIONS\" then\
           local duration = 8\
           local overlay = {}\
           for i=1, 4 do\
               overlay[i] = {\
                   min = (duration/4)*(i-1),\
                   max = (duration/4)*i,\
                   offset = (i*25) - 25,\
               }\
           end\
           s[\"\"] = {\
               show = true,\
               autoHide = false,\
               progressType = \"timed\",\
               duration = 8,\
               expirationTime = GetTime()+4,\
               text1 = \"Frontal\",\
               text2 = \"Frontal\",\
               text3 = \"Group\",\
               text4 = \"Group\",\
               --[[ duration = duration,\
               expirationTime = GetTime()+duration,]]\
               changed = true,\
               --  additionalProgress = overlay,\
               casting = 1,\
               first = 1,\
           }\
           \
           return true\
       elseif e == \"NSAPI_ENCOUNTER_START\" then\
           aura_env.casts = 0\
           aura_env.combos = {false, false, false, false} -- combos are frontal + frontal --- frontal + conquer --- conquer + conquer --- conquer + frontal No need to track more than first two casts\
           aura_env.difficulty = select(3, GetInstanceInfo())    \
       elseif e == \"UNIT_SPELLCAST_START\" then\
           local u, cast, spellID = ... -- Unit event\
           if spellID == aura_env.conquer or spellID == aura_env.vanquish then\
               local now = GetTime()\
               aura_env.last = now\
               if now > aura_env.last+15 then -- it's been very long since the last cast so boss likely bugged out and this is the start of a new sequence.\
                   aura_env.casts = 1\
               end\
               aura_env.casts = aura_env.casts+1\
               local duration = spellID == aura_env.conquer and 16 or 10   \
               if aura_env.difficulty == 14 or aura_env.difficulty == 17 then \
                   duration = spellID == aura_env.conquer and 24 or 12 -- casts are longer on normal and probably lfr\
               end \
               local overlay = {}\
               for i=1, 4 do\
                   overlay[i] = {\
                       min = (duration/4)*(4-i),\
                       max = (duration/4)*(5-i),\
                       offset = (i*25) - 25,\
                   }\
               end\
               local state = {            \
                   show = true,\
                   autoHide = false,\
                   progressType = \"timed\",\
                   duration = duration,\
                   expirationTime = GetTime()+((duration/4)*(5-aura_env.casts)),\
                   changed = true,\
                   casting = spellID == aura_env.vanquish and 1 or 2,\
                   additionalProgress = overlay,\
               }\
               if aura_env.difficulty == 14 then -- normal has hardcoded order\
                   state.text1 = \"Group 1\"\
                   state.text2 = \"Frontal\"\
                   state.text3 = \"Frontal\"\
                   state.text4 = \"Group 2\"\
                   state.first = (aura_env.casts == 1 and 1) or 3\
                   state.second = (aura_env.casts == 1 and 4) or (aura_env.casts == 2 and 1) or 2\
                   state.third = (aura_env.casts <= 2 and 4) or (aura_env.casts == 3 and 1) or 2\
                   state.fourth = aura_env.casts == 4 and 1 or 5\
                   s:Update(\"\", state)\
               else\
                   if aura_env.casts == 1 then               \
                       state.first = 1\
                       local second = 0\
                       local fourth = 0\
                       local text2 = \"\"\
                       local text3 = \"\"\
                       local text4 = \"\"\
                       -- if one of the combos with this cast first has already happened this pull then we already know the entire combo from the first cast because no combo can happen twice\
                       if spellID == aura_env.vanquish and (aura_env.combos[1] or aura_env.combos[2]) then\
                           second = aura_env.combos[1] and 5 or 4\
                           fourth = aura_env.combos[1] and 4 or 5\
                           text2 = second == 5 and \"Group 1\" or \"Frontal\"\
                           text3 = second == 5 and \"Group 2\" or \"Group 1\"\
                           text4 = fourth == 5 and \"Group 2\" or \"Frontal\"\
                       elseif spellID == aura_env.conquer and (aura_env.combos[3] or aura_env.combos[4]) then\
                           second = aura_env.combos[3] and 4 or 5\
                           fourth = aura_env.combos[3] and 5 or 4\
                           text2 = second == 5 and \"Group 2\" or \"Frontal\"\
                           text3 = \"Frontal\"\
                           text4 = fourth == 5 and \"Group 2\" or \"Frontal\"\
                       end\
                       state.second = second\
                       state.third = spellID == aura_env.vanquish and 5 or 4\
                       state.text1 = spellID == aura_env.vanquish and \"Frontal\" or \"Group 1\"\
                       state.text2 = text2\
                       state.text3 = (text3 ~= \"\" and text3) or (spellID == aura_env.vanquish and \"Group\") or \"Frontal\"\
                       state.text4 = text4\
                       state.fourth = fourth\
                       s:Update(\"\", state)\
                   elseif aura_env.casts == 2 then         \
                       state.first = s[\"\"].casting == 1 and 2 or 3\
                       state.second = 1\
                       state.fourth = spellID == aura_env.vanquish and 5 or 4\
                       state.text2 = (spellID == aura_env.vanquish and \"Frontal\") or (state.first == 3 and \"Group 2\") or \"Group 1\"               \
                       state.text3 = (s[\"\"].text3 == \"Frontal\" and \"Frontal\") or (state.fourth == 5 and \"Group 1\") or \"Group 2\"\
                       state.text4 = spellID == aura_env.vanquish and \"Group 2\" or \"Frontal\"\
                       s:Update(\"\", state)\
                       \
                   elseif aura_env.casts == 3 then          \
                       state.second = s[\"\"].casting == 1 and 2 or 3\
                       state.third = 1\
                       s:Update(\"\", state)\
                   elseif aura_env.casts == 4 then         \
                       state.third = s[\"\"].casting == 1 and 2 or 3\
                       state.fourth = 1\
                       s:Update(\"\", state)                \
                   end\
               end\
           end\
       elseif e == \"UNIT_SPELLCAST_SUCCEEDED\" then        \
           local u, cast, spellID = ... -- Unit event\
           if spellID == 1227734 and s[\"\"] then -- force hide for early push\
               s:RemoveAll()\
           elseif spellID == aura_env.conquer or spellID == aura_env.vanquish then\
               if aura_env.casts >= 4 then\
                   if s[\"\"] and s[\"\"].first == 2 then -- frontal was first\
                       if s[\"\"].second == 2 then -- frontal was second\
                           aura_env.combos[1] = true\
                       elseif s[\"\"].second == 3 then -- conquer was second\
                           aura_env.combos[2] = true                        \
                       end\
                   elseif s[\"\"] and s[\"\"].first == 3 then -- conquer was first                    \
                       if s[\"\"].second == 2 then -- frontal was second\
                           aura_env.combos[4] = true                        \
                       elseif s[\"\"].second == 3 then -- conquer was second\
                           aura_env.combos[3] = true                        \
                       end\
                   end\
                   aura_env.casts = 0                \
                   if aura_env.combos[1] and aura_env.combos[2] and aura_env.difficulty ~= 14 then\
                       WeakAuras.ScanEvents(\"NS_COMBO_TEXT\", \"|cFF00FF00Group Soak First\")                    \
                   elseif aura_env.combos[3] and aura_env.combos[4] and aura_env.difficulty ~= 14 then\
                       WeakAuras.ScanEvents(\"NS_COMBO_TEXT\", \"|cFFFF0000Frontal First\")    \
                   end\
                   s:RemoveAll() \
               end\
           end\
       end\
   end\
